import './App.css';
import React from 'react'
import Header from './components/Header'
import Pages from './components/Pages'
import Footer from './components/Footer'

function App() {

  return (
    <div className="App">
      <div className="header">
        <Header />
      </div>
      <div className="main">
        <Pages />
      </div>
      <div className="footer">
        <Footer />
      </div>
    </div>
  );
}

export default App;
